import React,{useState } from 'react';

const Searchbutton = props => {
    const[Value,setValue] = useState(props.value);


    return (
        <div>
            <input type = "text" value={Value} placeholder="Search by movie title or content" onChange ={e=>{setValue = e.target.value;
        props.change(Value);}}></input>
        </div>
    )
}
export default Searchbutton;
